import styles from './card.module.css'; 

const CardView = ({ product }) => {
  const { name, description, image, number, price } = { ...product };

  return (
    <div className={styles.container}>
      <div >
        {image}
      </div>
      <div>
        <div>
          {name}
        </div>
        <div>
          {description}
        </div>
        <div>
          {number}
        </div>
          {price}
        </div>
    </div>
    );
}

export default CardView;
